[[File:Bird nest (seeds, 2005-2019) detail.png|left|200px]]
The discontinued '''bird nest''' with seeds is an old variant of the [[Bird nest (seeds)|seed nest]] that was obtainable before the release of the [[Farming Guild]]. All nests previously obtained remained in banks and inventories, and all new nests obtained can now reward [[dragonfruit tree seed|dragonfruit]], [[celastrus seed|celastrus]], and [[redwood tree seed]]s. This change was made to prevent players from obtaining large quantities of the new seeds immediately upon release of the content.

This variant of bird nest can be seen during in [[Cyrisus|Cyrisus's]] bank during [[Dream Mentor]], but it can't be removed from the bank interface.

